    "import matplotlib.pyplot as plt\n",
    "\n",
    "\n",
    "\"\"\"\n",
    "KE = hf - W \n",
    "\n",
    "f = c/lambda\n",
    "\n",
    "def current_vs_voltage():\n",
    "    f = c/wl\n",
    "    \n",
    "    V = h * f/e - W/e\n",
    "    \n",
    "    #I = \n",
    "\n",
    "    return V\n",
    "\n",
    "def current_vs_intensity():\n",
    "    \n",
    "    eV = h * f - W\n",
    "    \n",
