    "plt.ylabel(\"Energy (eV)\")\n",
    "plt.grid()\n",
    "\n",
    "#Curve Fit\n",
    "def func(x,m,b):\n",
    "    return m*x + b\n",
    "\n",
    "pos = np.where(eV > 0)\n",
    "popt, pcov = curve_fit(func,freq[pos],eV[pos]) \n",
    "\n",
    "# slope: h(Plancks) y-int: Work function\n",
    "h,W = popt\n",
    "\n",
    "# Threshold wavelength at which photons become excited \n",
    "freq_th = -W/h\n",
    "wl_th = c/freq_th \n",
